import React from "react";

// We import NavLink to utilize the react router.
import { NavLink } from "react-router-dom";

// Here, we display our Navbar
export default function Navbar() {
 return (
   <section className="navbar">
     <nav>
				<div className="leftNav">
					<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="50px" height="50px">
						<path fill="#000000" d="M3,6H21V8H3V6M3,11H21V13H3V11M3,16H21V18H3V16Z" />
					</svg>
					<NavLink to="/">
						<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="50px" height="50px">
							<path fill="#000000" d="M10,20V14H14V20H19V12H22L12,3L2,12H5V20H10Z" />
						</svg>
					</NavLink>
			 	</div>
				<input type="search" className="navbarSearch" name="searchBar"/>
				<div className="rightNav">
					<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24">
						<path fill="#000000" d="M19,13H13V19H11V13H5V11H11V5H13V11H19V13Z" />
					</svg>
				</div>
			</nav>
   </section>
 );
}
